        <>
        <div className="row card m3 row rowsOfCards">
            <div className="row">{
 Object.keys(data).map((x)=> <div className="col bRd5"><img src={data[x].photograph} alt="" /><h4></h4></div>)
            }
           </div>

        </div>
        </>
     );
}

